このページで作成するファイルをダウンロード
行を選択できるようにする
基本的な説明を終えたところで、カスタマイズしないで使ってみるで問題になっていた箇所を解決してゆきましょう。デフォルト状態のエクステンションは次の3点が問題になっていました。

軸年月日をクリックしても項目が選択されない
セルの背景色が設定できない
スタイルが適用されておらず、チャートにおしゃれ感が足りない

まずはテーブルの軸をクリックしたときに行が選択されるように変更しましょう。
jsファイルの構成
TableExtension.jsを編集する前に、まずはファイルをざっと眺めてみましょう。次の画像はファイルをざっくりと折りたたんだ状態にしたものです。このページでは赤枠で囲った createRows() と paint() 関数の2か所を編集します。

エクステンションが読み込まれる際、2行目にある define() の引数になっている関数の処理内容が1回だけ実行されます。その中で createRows() 関数が定義されます。この関数は paint() から呼び出されます。その後シートを開いたとき、選択状態が変化したときなどに paint() 関数にある描画処理が呼び出されます。Qlik Senseのエクステンション開発では主に上記の2か所を編集することになります。
変更内容
JavaScriptから項目を選択したいときはQlik Sense APIを使用します。今回使用するのは backendApi.selectValues(qDimNo, qValues, qToggleMode)です。
(関数のヘルプ) 
変更点は2か所あります。最初に、テーブルを作成する時に行番号など選択に必要な情報をHTMLに埋め込んでおきます。その後要素にイベントリスナーを追加し、APIを呼び出して選択状態を変更します。
変更点①
TableExtension.jsにコードを追加します。ファイル5行目～のcreateRows()関数に追記します。
    function createRows ( rows, dimensionInfo ) {
        var html = "";
        rows.forEach( function ( row ) {
            html += '';
            row.forEach( function ( cell, key ) {
                if ( cell.qIsOtherCell ) {
                    cell.qText = dimensionInfo[key].othersLabel;
                }
                html += " option(白状態)
                    // "S" => selected(緑状態) 
                    // "X" => excluded(灰色状態)
                    // "L" => 数式
                    html += " qDim ";
                    html += " qElemNumber='" + cell.qElemNumber + "' ";
                    html += " qDimNumber='" + key + "' ";
                }
                // ---------- 追加 ここまで ----------
                html += '>' + cell.qText + '';
            } );
            html += '';
        } );
        return html;
    }

変更点②
ファイル後半にあるpaint()関数のreturn文直前にクリックされたときの処理を追加します。  
