エクステンション定義にプロパティを追加することで「背景色」「テキストの色」の数式が入力できるようになります。色の数式を入力しておきましょう。背景色:  =ColorMix1(Sum([販売金額]) / Max(Total Aggr(Sum([販売金額]),年月日)), RGB(128,128,128), RGB(0,255,0))テキストの色: =argb(255,255,255,255)
プロパティを設定したら、Qlik Senseから受け取った色の情報をDOMのスタイルとして適用するロジックを作成しましょう。ロジックの変更箇所は2か所です。1か所目の変更点はファイルの先頭付近の関数定義です。
関数cellToColor()はセルの情報を受け取り、色の情報を返します。
define( ["qlik", "jquery", "text!./style.css"], function ( qlik, $, cssContent ) {
    'use strict';
    $( "" ).html( cssContent ).appendTo( "head" );
    // ---------- 追加 ここから (背景色・テキストの色設定) ----------
    function cellToColor(cell, expressionNumber) {
        // expressionNumber
        // => 0: 背景色
        // => 1: テキストの色

        // プロパティが存在するか確認
        if(cell.qAttrExps !== undefined){
            if(cell.qAttrExps.qValues !== undefined){
                if(cell.qAttrExps.qValues[expressionNumber] !== undefined){
                    const colorNum = cell.qAttrExps.qValues[expressionNumber].qNum;
                    if (isNaN(colorNum)){
                        return null;
                    }
                    // Qlik Senseの色表現はARGB, CSSはRGBAなので順序を変換する
                    const argb = ('00000000' + colorNum.toString(16)).slice(-8); // 10進数→16進数、桁数が足りない場合0埋めする
                    const a = parseInt(argb.slice(0, 2), 16);
                    const r = parseInt(argb.slice(2, 4), 16);
                    const g = parseInt(argb.slice(4, 6), 16);
                    const b = parseInt(argb.slice(6, 8), 16);
                    if(!isNaN(a) && !isNaN(r) && !isNaN(g) && !isNaN(b)){
                        return 'rgba(' + r + ',' + g + ',' + b + ',' + a + ')';
                    }
                }
            }
        }
        // 色情報が存在しない、もしくはRGB(), ARGB()のフォーマットではない場合nullを返す
        return null;
    }
    // ---------- 追加 ここまで ----------

