Tutorial2/Show_Sheets.html.body:
このページで作成するファイルをダウンロード
シート一覧を表示する
これから作成する「シート一覧を表示する」機能は新規エクステンションとして独立したものにします。ブランクのエクステンションを作成しましょう。
Dev Hubから新しいエクステンションを作成します。 

jsファイル内に次の内容を記述します。今回は paint メソッドは使用しません。代わりにQlik Senseに組み込まれたフレームワークの AngularJS を利用しています。テンプレートとなるHTMLを template に、ロジック部分は controllerに記述します。このように、 paint メソッドの代わりに template と controller を活用することでデザインとロジックを分離し、見通しのよいコードにすることができます。もちろん、前の章までのように paint メソッドを利用してもよいですが、あらかじめ出力するHTMLの形がある程度予想できる場合にはフレームワークを利用するとよいでしょう。AngularJSについては AngularJS公式マニュアルも参考にしてください。
以下、サンプルコードです。app APIによって取得したシート名とIDの情報をボタンに設定し、それをクリックするとNavigation APIによってシート遷移を行います。スタイルはLeonardo UIのTabsetを利用しています。
'use strict';
define( [ "qlik"
],
function (qlik) {
    return {
        support : {
            snapshot: true,
            export: true,
            exportData : false
        },
        template: `




                            {{sheet.title}}




        `,
        controller: ['$scope', function( $scope ) {
            $scope.sheets = function(){
                // シートのタイトル・シートIDの一覧を取得する
                const app = qlik.currApp();
                let sheetList = [];
                app.getList("sheet").then(function(result){
                    result.layout.qAppObjectList.qItems.forEach(element => {
                        let item = {
                            title: element.qMeta.title,
                            id : element.qInfo.qId
                        };
                        sheetList.push(item);
                    });
                });
                return sheetList;
            }();

            $scope.gotoSheet = function(id){
                // IDで指定されたシートに移動する
                qlik.navigation.gotoSheet(id);
            }
        }]
    };
});

作成したエクステンションの見た目は以下のようになります。
シート名のテキストをクリックするとそのシートへ移動することができます。

Tutorial2/Naviation_Button.html.body:
このページで作成するファイルをダウンロード
戻る・進む・選択のクリアボタンを表示する
引き続き、「戻る」・「進む」・「選択をクリア」するボタンのエクステンションを作成しましょう。シート一覧を表示する機能を作成したときと同様にここでも新しいエクステンションを作成します。エクステンション名は Navigation_Button とします。
jsファイルを開き、以下のように編集します。オブジェクトに表示するボタンは固定のため、テンプレートにHTMLを記入することで見通しよく記述できます。
ボタンが押されたときの処理はコントローラーに記述し、それぞれの関数がQlik Senseの app APIを呼び出して状態遷移を実現しています。
'use strict';
define( [ "qlik"
],
function (qlik) {
    return {
        support : {
            snapshot: true,
            export: true,
            exportData : false
        },
        template: `



                戻る



                クリア


                進む



        `,
        controller: ['$scope', function( $scope ) {
            $scope.back = function(){
                // 選択を戻る
                const app = qlik.currApp();
                app.back();
            }

            $scope.forward = function(){
                // 戻した選択をやり直す
                const app = qlik.currApp();
                app.forward();
            }

            $scope.clear = function(){
                // 選択をクリア
                const app = qlik.currApp();
                app.clearAll();
            }
        }]
    };
});

エクステンションの見た目は以下のようになります。ボタンの色や表示されているアイコンを変更したい場合は Leonardo UI のドキュメントを参考にHTML部分を書き換えてみましょう。
